function get(t){return fetch(t,{method:"get"})}function getJSON(t){return get(t).then(function(t){return t.json()})}function outputJSON(){getJSON("data/global-top-10-tracks.json").then(function(t){document.querySelector(".json-output").innerHTML="<pre>"+JSON.stringify(t,null,2)+"</pre>",console.log(t)}).catch(function(t){console.log(t)})}outputJSON();